import React from "react";

function PersonForm(props) {
  return (
    <>
      <h3>{props.values.name}</h3>
      <form>
        <input
          type="text"
          value={props.values.name}
          onChange={props.onChange}
        />
      </form>
    </>
  );
}

export default PersonForm;
